import styled from "styled-components"
import { Image, Content, Description, Title } from "../components/modules"

const ThirdPage = () => {
  return (
    <Background>
      <Content>
        <Title>모티를 키우려면?</Title>
        <Description>
          모티를 키우기 위해서는 레포지토리가 있는 깃허브 계정이 필요해요.
          깃허브를 통해 인증한 후, 로그인해주세요. 로그인한 후에 모티에게 밥을
          주기 위한 밥그릇을 정해주세요. 밥그릇은 커밋을 확인하기 위한
          레포지토리를 의미해요. 1개 이상 5개 이하의 밥그릇을 지정해주세요.
          모티의 이름을 정해주고 나면 모티를 키울 수 있어요
        </Description>
      </Content>
      <Image />
    </Background>
  )
}

export default ThirdPage

const Background = styled.div`
  height: 67vh;
  background: #f0f0f0;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
`
